import './hero.css';
import "../../Assets/hero"
const Hero = () => {
    return ( 
        <div className="home">
            <div className="home-in">
                <div className="home-in-text">
                    <h1>Empower the World</h1>
                    <h2>By Saving tree's</h2>
                </div>
                <div className="home-in-button">
                    <div className="home-in-button-in">
                        <button>Get Started</button>
                    </div>
                </div>
            </div>
        </div>
     );
}

export default Hero;
